import React from "react";
import PropTypes from "prop-types";
import './CardNews.scss';
CardNews.propTypes = {
  news:PropTypes.object.isRequired,
  navigatorClick:PropTypes.func,
};
CardNews.defaultProps = {
  navigatorClick: null,
};
function CardNews(props) {
  const { news, navigatorClick } = props;
  function handleNewsClick(item) {
    if (navigatorClick) {
      navigatorClick(item);
    }
  }
  //require("../../assets/images/camera.jpg").default
  return (
    <div className="CardNews">
      <div className="CardItem">
        <div className="ImageItem">
          <img className="Image" src={news.urlImage} />
        </div>
        <div className="ContentItem">
          <h4 className="TitleItem" onClick={() => handleNewsClick(news)}>
            {news.tilte}
          </h4>
          <div className="Date">
            <span>08/01/2015</span>
          </div>
          <p>
            Dell nhấn mạnh rằng chiếc XPS 13 của họ năm nay còn nhận được nhiều
            cải tiến tốt hơn, vượt trội hơn nhiều so với các phiên bản trước.
          </p>
        </div>
      </div>
    </div>
  );
}

export default CardNews;
